Mongo aggregation: How to exclude items from array, if they don't have specific keys?<p>I have a following data:</p>
<pre><code>{
  &quot;Name&quot;: &quot;Test&quot;
  &quot;Location&quot;: &quot;Whatever&quot;,
  &quot;customerServices&quot;: [
      {
        &quot;id&quot;: &quot;test&quot;,
        &quot;cusId&quot;: &quot;test&quot;,
        &quot;adr&quot;: &quot;Adr 1&quot;,
        &quot;serviceCounty&quot;: &quot;Center&quot;,
        &quot;area&quot;: &quot;village&quot;
      },
      {
        &quot;id&quot;: &quot;test&quot;,
        &quot;cusId&quot;: &quot;test&quot;,
        &quot;adr&quot;: &quot;adr2&quot;,
        &quot;serviceCounty&quot;: &quot;West&quot;,
        &quot;area&quot;: &quot;city&quot;
      },
      {
        &quot;id&quot;: &quot;test&quot;,
        &quot;cusId&quot;: &quot;test&quot;,
        &quot;adr&quot;: &quot;test&quot;,
        &quot;serviceCounty&quot;: &quot;West&quot;,
      }
  ]
}
</code></pre>
<p>I need to check the array of elements (customerServices field) and filter it then. I have to check that each element has the following 3 keys:</p>
<ol>
<li>adr</li>
<li>serviceCounty</li>
<li>area</li>
</ol>
<p>If any of these keys is missing, then this item in the array should be totally excluded. So the final result in this example would be:</p>
<pre><code>{
  &quot;Name&quot;: &quot;Test&quot;
  &quot;Location&quot;: &quot;Whatever&quot;,
  &quot;customerServices&quot;: [...],
  &quot;filteredCustomerServices&quot;: [
      {
        &quot;id&quot;: &quot;test&quot;,
        &quot;cusId&quot;: &quot;test&quot;,
        &quot;adr&quot;: &quot;Adr 1&quot;,
        &quot;serviceCounty&quot;: &quot;Center&quot;,
        &quot;area&quot;: &quot;village&quot;
      },
      {
        &quot;id&quot;: &quot;test&quot;,
        &quot;cusId&quot;: &quot;test&quot;,
        &quot;adr&quot;: &quot;adr2&quot;,
        &quot;serviceCounty&quot;: &quot;West&quot;,
        &quot;area&quot;: &quot;city&quot;
      }
  ]
}
</code></pre>
<p><strong>As you can see the last item was excluded, beacause it had 'area' key missing.</strong> Any ideas how to achieve that? Really stuck with this mongo aggregation topic.</p>

