Promotion &gt;= 6 points &amp; Relegation &lt; 4 points.</p>
<p>I am in Season 1, Division 8. I have 1 match in my database that is for season 1, it was a win so 3 points.</p>
<p>I then have [{&quot;season&quot;: &quot;1&quot;, &quot;Score&quot;: &quot;1-0&quot;}, {&quot;season&quot;: &quot;1&quot;, &quot;Score&quot;: &quot;2-0&quot;}, {&quot;season&quot;: &quot;2&quot;, &quot;Score&quot;: &quot;3-0&quot;}]</p>
<p>The first two matches in the array are for season 1 so I know this is division 8.</p>
<p>For the third match I need to check the result of Season 1 to know what division Season 2 should be. My issue is that when I check this it is only checking based on the very first match and it is saying 3 points when it should be 9 points.</p>
<p>How do I force Mongoose to use the latest snapshot of my database and not one from the very start of the function?</p>
<p>Matches.js</p>
<pre><code>const router = require('express').Router();

const Match = require('../../models/match.model');

const getSeasonData = require('./getSeasonData');

router.route('/getNewMatches').post(auth, async (req, res) =&gt; {
  const matches = await Match.find();

  const getDivisionBasedOnSeasonResult = async () =&gt; {
    const seasonData = await getSeasonData(seasonOfLastGame);
    console.log({ seasonData });
    switch (seasonData[0].seasonResult) {
      case &quot;Promoted&quot;:
        return seasonData[0].division - 1;
      case &quot;Remained&quot;:
        return seasonData[0].division;
      case &quot;Relegated&quot;:
        return seasonData[0].division + 1;
      default:
        console.log(&quot;result not one of the three values&quot;);
    }
  }

  const eaMatches = [{&quot;season&quot;: &quot;1&quot;, &quot;Score&quot;: &quot;1-0&quot;}, {&quot;season&quot;: &quot;1&quot;, &quot;Score&quot;: &quot;2-0&quot;}, {&quot;season&quot;: &quot;2&quot;, &quot;Score&quot;: &quot;3-0&quot;}]

  let seasonOfLastGame = 1;

  for (const match of eaMatches) {

      if (seasonOfLastGame === season) {
        division = 8;
      } else {
        division = await getDivisionBasedOnSeasonResult();
      }

      seasonOfLastGame = season;

      const newMatch = new Match({
        division,
      });
      newMatch.save()
        .then(() =&gt; {
          res.json('Match added!')
        })
        .catch(err =&gt; res.status(400).json('Error: ' + err));
  };
});

module.exports = router; 
</code></pre>
<p>getSeasonData.js</p>
<pre><code>const Match = require('../../models/match.model');

const getSeasonData = async seasonOfLastGame =&gt; {

    const stages = [
        { &quot;$match&quot;: { season: seasonOfLastGame } }
        {
            &quot;$group&quot;:
            {
                &quot;_id&quot;: &quot;$season&quot;,
                &quot;points&quot;: {
                    &quot;$sum&quot;: {
                        &quot;$add&quot;: [{&quot;$sum&quot;: { $cond: [{ $eq: ['$result', &quot;Win&quot;] }, 1, 0] } }]
                    }
                },
                &quot;teamPlayed&quot;: { $sum: 1 }
            }
        },
        { &quot;$sort&quot;: { &quot;_id&quot;: 1 } },
        {
            &quot;$project&quot;: {
                &quot;seasonResult&quot;:
                {
                    $switch:
                    {
                        branches: [
                            {
                                case: {$gte: [&quot;$points&quot;, 6] },
                                then: &quot;Promoted&quot;
                            },
                            {
                                case: {$gte: [&quot;$points&quot;, 4] },
                                then: &quot;Remained&quot;
                            },
                            {
                                case: {$lt: [&quot;$points&quot;, 4] },
                                then: &quot;Relegated&quot;
                            }
                        ],
                        default: &quot;Result not available&quot;
                    }
                }
            },
        }
    ]

    return Match.aggregate(stages);
}

module.exports = getSeasonData;
</code></pre>

